      name: "",
      email: "",
      phone: "",
      password: "",
      rePassword: "",
    },
  });

  function submitRegisterForm() {
    console.log('submit');
  }

  return (
    <>
      <form>
        <input className="w-100" onSubmit={formik.handleSubmit} />
      </form>
    </>
  );
}
